-- VisualPlugin was here
_G.AutoBurritoBuilder = function(Value)
    AutoBurrito = Value
    if AutoBurrito then
        c = 0
        for i, v in pairs(game:GetDescendants()) do
        	if v:IsA("GuiBase2d") then
        		v.AutoLocalize = false
        	end
        end
        game:GetService("ReplicatedStorage").RemoteEvent:FireServer("startBurritoBuilder")
        while AutoBurrito and wait(3) do
        	c = c + 1
			game:GetService("StarterGui"):SetCore("SendNotification", {
				Title = "VisualPlugin",
				Text = "Made " .. c .. " Burritos",
				Duration = 1
			})
        	warn("Successfully Made: " ..  c .. " Burritos")
        end
        game:GetService("ReplicatedStorage").RemoteEvent:FireServer("burritoBuilderResults", {c})
        game:GetService("ReplicatedStorage").RemoteEvent:FireServer("togglePlayerVisible", false)
    end
end

